  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bowdoin NWR outlines
  Refuge accomplishments from May through August of 1950. The report begins by summarizing
  the weather conditions, water conditions, and food and cover during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, fish, and disease- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  and collections and receipts. Resource management is outlined; topics include grazing.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and Refuge participation. Items of interest, N-R forms, and update on the easement
  refuges, and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
